import React from 'react'
import ReactDOM from 'react-dom'
import Logo from './logo192.png'



let college='SVECW'

function Welcome(){
    return(
        <div>
            <h1>Welcome to {college}</h1>
            <img src={Logo}/>
        </div>
    );
}
